;;; # Simplify Numeric Extraction
;;; 
;;; * ```get-numeric-stats``` fn chains ```x-numeric-map``` with an arbitrary xform and returns a lazy transformer for all fighters.
;; **

;; @@
(defn get-numeric-stats [xform]
  (sequence (comp x-numeric-map
                  xform)
            (stats)))

