(def x-fighting-out-of
   (map #(get % "FightingOutOf")))

(def x-fighting-out-of-city
  (comp
   x-fighting-out-of
   (map #(get % "City"))))

(def x-fighting-out-of-state
  (comp
   x-fighting-out-of
   (map #(get % "State"))))

(def x-fighting-out-of-country
  (comp
   x-fighting-out-of
   (map #(get % "Country"))))

(->> females
     (sequence x-fighting-out-of-city)
     (take 3)
     (reduce #(str %1 ", " %2))
     (str "First 3 Example: Fighting out of => ")
     pprint)
