;; **
;;; # Charting Non-numeric Attributes
;;; 
;;; **Scroll beyond the code if you just want the chart**
;; **

;; @@
(defn chart-horizontal-percent-bars
  [xform
   limit
   data
   data-color
   bar-color]
  (as-> data x      
        (sequence xform x)
        (frequent x)
        (sort-by :count x)
        (reverse x)
        (take limit x)
        (let [cs (map :count x)
              amount (reduce + cs)
              per (memoize
                   (fn [count]
                     (Float/parseFloat
                      (format "%3.3f"
                              (* 100.0
                                 (float
                                  (/ count amount)))))))]
          (->html
           (into [:table
                  {:style "tr td {border-style:none;padding:10px;}"}]
                 
                 (for [{:keys [value count]} x
                       :let [p (per count)]]
                   [:tr 
                    [:td (or value "No Record :(")]
                    [:td p "%"]
                    [:td.container
                     (for [f (range 0.001 101)]
                       [:span {:style
                               (format
                                "background:%s;"
                                (if (<= f p)
                                  data-color
                                  bar-color))}
                        " "])]]))))))  

(chart-horizontal-percent-bars  x-fighting-out-of-city
                                20
                                females
                                female-color
                                "black")
