;;; # Flattening Fighters
;; **

;; @@
(defn recursive-flatten-map
  [init-map m]
  (if-not (seq m)
    init-map
    (let [[k v] (first m)]
      (if-not (map? v)
        (recur (assoc init-map k v)
               (rest m))
        (recur init-map
               (into (rest m) v))))))

(defn flatten-fighter
  [fighter]
  (as-> fighter f
      (without f "Fights")
      (recursive-flatten-map {} f)
      (let [t (transient {:fighter f})]
        (doseq [x ["Abbreviation"
                   "AverageFightTime"
                   "Current"
                   "DOB"
                   "Description"
                   "FighterID"
                   "CareerStats"
                   "MMAID"
                   "Name"
                   "NickName"
                   "Previous"
                   "WeightClassID"
                   "Type"]
                :let [f (:fighter t)]]
          (assoc! t :fighter (without f x)))
        (:fighter t))))

(-> females rand-nth flatten-fighter pprint)
